import React from 'react';
import { NavLink } from "react-router-dom";
import SideLeft from "./SideLeft"
import SideRight from "./SideRight"
const a = ["a", "b", "c", "d", "e", "f", "g", "h", "i", "j", "k", "l", "m", "n", "o", "p", "q", "r", "s", "t", "u", "v", "w", "x", "y", "z"]

function VerbList() {
    return (
        <div className="row d-flex allBody">
            <SideLeft />
            <div className="col-12 col-md-8 py-5 sideCenter ">
                <h1 className="mb-5"> All alphabete verbs</h1>
                {
                    a.map((element, index) => {
                        return (<NavLink to="/" className="mx-1 text-info " key={index}> {element}</NavLink>)
                    })
                }
            </div>
            <SideRight />
        </div>
    )
}

export default VerbList
